import React, { Component } from "react";
import {  Divider, Image } from 'semantic-ui-react'

class Pato extends Component {
    render() {
        return (
            <div>
                    <Image src={"../../press/acote.png"} size='large' />
                    <Divider hidden />
            </div>
        );
    }
}

export default Pato;
